<script type="text/javascript">document.write('\u003C\u0021\u0044\u004F\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006D\u006C\u003E\u000A\u003C\u0068\u0074\u006D\u006C\u003E\u000A\u003C\u0068\u0065\u0061\u0064\u003E\u000A\u0009\u003C\u006C\u0069\u006E\u006B\u0020\u0072\u0065\u006C\u003D\u0022\u0073\u0074\u0079\u006C\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u0063\u0073\u0073\u002F\u0064\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u002E\u0063\u0073\u0073\u0022\u003E\u000A\u0009\u003C\u006C\u0069\u006E\u006B\u0020\u0072\u0065\u006C\u003D\u0022\u0073\u0074\u0079\u006C\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u0063\u0073\u0073\u002F\u0070\u006F\u0070\u0075\u0070\u002E\u0063\u0073\u0073\u0022\u003E\u000A\u0020\u0020\u003C\u0074\u0069\u0074\u006C\u0065\u003E\u0053\u0069\u0074\u0075\u0073\u0020\u004A\u0075\u0064\u0069\u0020\u0054\u0065\u0072\u0020\u0047\u0061\u0063\u006F\u0072\u0020\u007C\u0020\u0053\u006C\u006F\u0074\u0020\u005A\u0065\u0075\u0073\u0020\u0037\u0037\u0037\u0020\u007C\u0020\u0053\u006C\u006F\u0074\u0020\u0047\u0061\u0063\u006F\u0072\u003C\u002F\u0074\u0069\u0074\u006C\u0065\u003E\u000A\u0020\u0020\u003C\u0073\u0074\u0079\u006C\u0065\u003E\u000A\u0020\u0020\u0020\u0020\u002E\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0020\u007B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u003A\u0020\u0069\u006E\u006C\u0069\u006E\u0065\u002D\u0062\u006C\u006F\u0063\u006B\u003B\u000A\u0020\u0020\u0070\u0061\u0064\u0064\u0069\u006E\u0067\u003A\u0020\u0031\u0030\u0070\u0078\u0020\u0032\u0030\u0070\u0078\u003B\u000A\u0020\u0020\u0062\u0061\u0063\u006B\u0067\u0072\u006F\u0075\u006E\u0064\u002D\u0063\u006F\u006C\u006F\u0072\u003A\u0020\u0023\u0034\u0043\u0041\u0046\u0035\u0030\u003B\u000A\u0020\u0020\u0063\u006F\u006C\u006F\u0072\u003A\u0020\u0023\u0066\u0066\u0066\u003B\u000A\u0020\u0020\u0074\u0065\u0078\u0074\u002D\u0064\u0065\u0063\u006F\u0072\u0061\u0074\u0069\u006F\u006E\u003A\u0020\u006E\u006F\u006E\u0065\u003B\u000A\u0020\u0020\u0066\u006F\u006E\u0074\u002D\u0073\u0069\u007A\u0065\u003A\u0020\u0032\u0034\u0070\u0078\u003B\u000A\u0020\u0020\u0062\u006F\u0072\u0064\u0065\u0072\u002D\u0072\u0061\u0064\u0069\u0075\u0073\u003A\u0020\u0034\u0070\u0078\u003B\u000A\u0020\u0020\u0020\u0020\u007D\u000A\u0020\u0020\u003C\u002F\u0073\u0074\u0079\u006C\u0065\u003E\u000A\u003C\u002F\u0068\u0065\u0061\u0064\u003E\u000A\u003C\u0062\u006F\u0064\u0079\u0020\u006F\u006E\u006C\u006F\u0061\u0064\u003D\u0022\u006F\u0070\u0065\u006E\u0050\u006F\u0070\u0075\u0070\u0028\u0029\u0022\u003E\u000A\u0020\u0020\u003C\u0068\u0031\u003E\u0054\u0065\u0073\u0020\u0044\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u0020\u0050\u0061\u0067\u0065\u0073\u003C\u002F\u0068\u0031\u003E\u000A\u000A\u0020\u0020\u003C\u0061\u0020\u0068\u0072\u0065\u0066\u003D\u0022\u0064\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u002E\u0070\u0068\u0070\u003F\u0066\u0069\u006C\u0065\u003D\u0066\u0069\u006C\u0065\u005F\u006E\u0061\u006D\u0065\u002E\u0070\u0064\u0066\u0022\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0064\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u002D\u0062\u0074\u006E\u0022\u0020\u0064\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u003E\u0044\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u0020\u0066\u0069\u006C\u0065\u003C\u002F\u0061\u003E\u000A\u0020\u0020\u003C\u0070\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0022\u003E\u003C\u002F\u0070\u003E\u000A\u000A\u000A\u0020\u0020\u003C\u0073\u0063\u0072\u0069\u0070\u0074\u003E\u000A\u0020\u0020\u0020\u0020\u0076\u0061\u0072\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0045\u006C\u0065\u006D\u0020\u003D\u0020\u0064\u006F\u0063\u0075\u006D\u0065\u006E\u0074\u002E\u0071\u0075\u0065\u0072\u0079\u0053\u0065\u006C\u0065\u0063\u0074\u006F\u0072\u0028\u0027\u002E\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0027\u0029\u003B\u000A\u0020\u0020\u0020\u0020\u0076\u0061\u0072\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0020\u003D\u0020\u0036\u003B\u0020\u0020\u002F\u002F\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0020\u0074\u0069\u006D\u0065\u0020\u0069\u006E\u0020\u0073\u0065\u0063\u006F\u006E\u0064\u0073\u000A\u000A\u0020\u0020\u0020\u0020\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0020\u0073\u0074\u0061\u0072\u0074\u0043\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0028\u0029\u0020\u007B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0076\u0061\u0072\u0020\u0074\u0069\u006D\u0065\u0072\u0020\u003D\u0020\u0073\u0065\u0074\u0049\u006E\u0074\u0065\u0072\u0076\u0061\u006C\u0028\u0066\u0075\u006E\u0063\u0074\u0069\u006F\u006E\u0028\u0029\u0020\u007B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u002D\u002D\u003B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0045\u006C\u0065\u006D\u002E\u0074\u0065\u0078\u0074\u0043\u006F\u006E\u0074\u0065\u006E\u0074\u0020\u003D\u0020\u0060\u0059\u006F\u0075\u0072\u0020\u0064\u006F\u0077\u006E\u006C\u006F\u0061\u0064\u0020\u0077\u0069\u006C\u006C\u0020\u0073\u0074\u0061\u0072\u0074\u0020\u0069\u006E\u0020\u0024\u007B\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u007D\u0020\u0073\u0065\u0063\u006F\u006E\u0064\u0073\u002E\u0060\u003B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0069\u0066\u0020\u0028\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0020\u003D\u003D\u003D\u0020\u0030\u0029\u0020\u007B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0063\u006C\u0065\u0061\u0072\u0049\u006E\u0074\u0065\u0072\u0076\u0061\u006C\u0028\u0074\u0069\u006D\u0065\u0072\u0029\u003B\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0063\u006F\u0075\u006E\u0074\u0064\u006F\u0077\u006E\u0045\u006C\u0065\u006D\u002E\u0074\u0065\u0078\u0074\u0043\u006F\u006E\ 06E\u0020\u002A\u0020\u0031\u0030\u0030\u0030\u0029\u003B\u000A\u0020\u0020\u0020\u0020\u007D\u0029\u003B\u000A\u0020\u0020\u003C\u002F\u0073\u0063\u0072\u0069\u0070\u0074\u003E\u000A\u0020\u0020\u003C\u0064\u0069\u0076\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0070\u006F\u0070\u0075\u0070\u0022\u003E\u000A\u0020\u0020\u0020\u0020\u003C\u0064\u0069\u0076\u0020\u0063\u006C\u0061\u0073\u0073\u003D\u0022\u0070\u006F\u0070\u0075\u0070\u002D\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0022\u003E\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u003C\u0068\u0032\u003E\u0053\u006C\u006F\u0074\u0020\u005A\u0065\u0075\u0073\u0020\u0037\u0037\u0037\u003C\u002F\u0068\u0032\u003E\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u003C\u0069\u006D\u0067\u0020\u0073\u0072\u0063\u003D\u0022\u0068\u0074\u0074\u0070\u0073\u003A\u002F\u002F\u0070\u006C\u0061\u0079\u002D\u006C\u0068\u002E\u0067\u006F\u006F\u0067\u006C\u0065\u0075\u0073\u0065\u0072\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u002E\u0063\u006F\u006D\u002F\u0047\u0068\u0079\u0078\u004F\u004F\u0038\u0071\u0050\u0030\u005F\u0033\u0055\u002D\u0066\u006F\u0045\u0054\u0033\u0073\u0072\u0061\u0073\u006C\u0061\u005F\u0048\u0042\u0059\u006A\u007A\u0039\u0034\u0032\u0072\u0073\u0055\u0065\u0052\u004F\u004A\u004D\u0068\u0049\u0059\u0065\u005A\u0051\u0074\u0051\u0039\u0036\u0074\u0066\u0069\u0058\u0071\u007A\u0059\u0079\u0050\u0065\u0034\u0053\u0063\u0041\u0075\u006C\u003D\u0077\u0032\u0032\u0030\u002D\u0072\u0077\u0022\u0020\u0061\u006C\u0074\u003D\u0022\u0050\u006F\u0070\u0075\u0070\u0020\u0049\u006D\u0061\u0067\u0065\u0022\u003E\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u003C\u0070\u003E\u0053\u006C\u006F\u0074\u0020\u0044\u0069\u006A\u0061\u006D\u0069\u006E\u0020\u0047\u0061\u0063\u006F\u0072\u003C\u002F\u0070\u003E\u000A\u0020\u0020\u0020\u0020\u0020\u0020\u003C\u0062\u0075\u0074\u0074\u006F\u006E\u0020\u006F\u006E\u0063\u006C\u0069\u0063\u006B\u003D\u0022\u0067\u006F\u0054\u006F\u0057\u0065\u0062\u0073\u0069\u0074\u0065\u0028\u0029\u002
